	[script]
	id="dialog_1"
		[modification]
		on_process="[speech_dialog(self, set(level.zoom, 2),
									set(level.player.facing, 1),
									set(level.focus, [self, level.player]),
									
									animation('mutter_begin'),
									[~So!  I've unlocked this gate, here.~],
									animation('mutter_begin'),
									[~Through there,~,~is the way to where Milgram lives.~],
									animation('mutter_begin'),
									[~It's all a bit convoluted,~,~and I would explain it,~,
									~but as a matter of fact, I don't need to.~],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~Huh?~],
									animation('mutter_begin'),
					self,			[~Yes, that blue fellow you ran into..~, ~Berd was his name.~],
									animation('mutter_begin'),
									[~He'll follow you from above,~, ~and will keep you informed.~],
									animation('mutter_begin'),
									[~He's a good boy, that one.~],
									set(level.player.animation, 'emote_nod'),
					level.player,	[~Okay, that'll help!~],
									animation('mutter_begin'),
					self,			[~Now, this'll take you over a bridge,~,~then through an underground passage.~],
									animation('mutter_begin'),
									[~Watch your head in there.~],
									animation('mutter_begin'),
									[~Past that, and you come to the forest.~],
									animation('mutter_begin'),
									[~I haven't been there in a long time,~,~so I'm not sure what's become of it.~],
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Right, I'll watch my back.~],
									animation('mutter_begin'),
					self,			[~Best of luck, my boy.~,~Milgram won't know what hit him!~],
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~You bet!~],
									set(level.player.animation, 'emote_confused'),
									[~Say, uh... by the way,~,~what's going to happen to town, here?~],
									animation('mutter_begin'),
					self,			[~Eh, don't worry about that.~],
									animation('mutter_begin'),
									[~With their leader gone, Milgram's goons~,~will probably pack up and leave.~],
									animation('mutter_begin'),
									[~And good riddance!~],
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Well, I'm off.~,~Thanks for the advice!~],
									animation('mutter_begin'),
					self,			[~Likewise.  Good luck!~],
									set(get_object(level,'town_elder').animation, 'run_scared'),
									
									set(level.zoom, 1),
									set(level.focus, []),
									set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['town-elder-post-fight-speech'])),
		
									schedule(1,begin_script('elder_disposal')),
		end_script()]"
		target="get_object(level,'town_elder')"
		[/modification]

	[/script]

	[script]
	id="elder_disposal"
		[modification]
		on_process="if(midpoint_x < 1790, [schedule(1,remove_object(me)), fire_event(get_object(level,'elder_door'),'open'),end_script()])"
		target="get_object(level,'town_elder')"
		[/modification]

	[/script]

